CREATE TABLE variants (
	id INTEGER NOT NULL, 
	del_ins VARCHAR(50), 
	variant_name VARCHAR(5000), 
	variant_size INTEGER, 
	variant_id VARCHAR(50000), 
	image_name VARCHAR(5000), 
	igv_image VARCHAR(50000), 
	"gEval_image" VARCHAR(50000), 
	"svviz_DotPlot_image" VARCHAR(50000), 
	"svviz_PB_image" VARCHAR(50000), 
	"svviz_Ill250_image" VARCHAR(50000), 
	"svviz_Ill300x_image" VARCHAR(50000), 
	"svviz_10X_image" VARCHAR(50000), 
	"svviz_MP_image" VARCHAR(50000), 
	PRIMARY KEY (id)
);

